            HornCircle1 = Circle.ByCenterPointRadiusNormal(Point.ByCoordinates(-1.402 * 2, -0.350 * 2, 4.294 * 2), 0.12*2, Vector.ByCoordinates(0 * 2, 1 * 2, 0 * 2));
            HornCircle2 = Circle.ByCenterPointRadiusNormal(Point.ByCoordinates(-1.509 * 2, -0.485 * 2, 4.298 * 2), 0.097 * 2, Vector.ByCoordinates(0 * 2, 0.903 * 2, -0.429 * 2));
            HornCircle3 = Circle.ByCenterPointRadiusNormal(Point.ByCoordinates(-1.537 * 2, -0.668 * 2, 4.370 * 2), 0.074 * 2, Vector.ByCoordinates(0 * 2, -0.554 * 2, 0.832 * 2));
            HornCircle4 = Circle.ByCenterPointRadiusNormal(Point.ByCoordinates(-1.640 * 2, -0.775 * 2, 4.582 * 2), 0.056 * 2, Vector.ByCoordinates(0 * 2, 0 * 2, 1 * 2));
            HornCircle5 = Circle.ByCenterPointRadiusNormal(Point.ByCoordinates(-1.718 * 2, -0.816 * 2, 4.779 * 2), 0.012*2, Vector.ByCoordinates(0 * 2, 0.388 * 2, 0.921 * 2));
            HornCircleList = new Circle[] {HornCircle1, HornCircle2, HornCircle3, HornCircle4, HornCircle5 };

            //PLANES
            MirrorPlane = Plane.ByOriginNormal(Point.ByCoordinates(0, 0, 0), Vector.ByCoordinates(0, 2, 0));

            //SURFACES
            Surfacetorso = NurbsSurface.ByLoft(Curvestorso);
            Surfaceleg = NurbsSurface.ByLoft(Curvesleg);
            Eyeball = Sphere.ByCenterPointRadius(SphereCenterPoint, 0.096 * 2);
            Horn = NurbsSurface.ByLoft(HornCircleList);

            //MIRRORED SURFACES
            MirrorSurfacetorso = Surfacetorso.Mirror(MirrorPlane);
            MirrorSurfaceleg = Surfaceleg.Mirror(MirrorPlane);
            MirrorEyeball = Eyeball.Mirror(MirrorPlane);
            MirrorHorn = Horn.Mirror(MirrorPlane);

            //ROTATING CURVES
            HeadCurves = new NurbsCurve[] {Curvestorso[59], Curvestorso[58] }; 
            
            //RETURNING
            Dictionary<string, object> OutInfo = new Dictionary<string, object>

            {
                
//              {"Curvestorso",Curvestorso},
//              {"Curvesleg",Curvesleg},

                {"Surfacetorso",Surfacetorso},
                {"Surfaceleg",Surfaceleg},
                {"Eye",Eyeball},
                {"Horn",Horn},

                {"MirrorSurfacetorso",MirrorSurfacetorso},
                {"MirrorSurfaceleg",MirrorSurfaceleg},
                {"MirrorEye",MirrorEyeball},
                {"MirrorHorn",MirrorHorn}

            };

            //DISPOSING

            for (int i = 0; i < Pointstorso.Length; i++)
            {
                for (int j = 0; j < Pointstorso[i].Length; j++)
                {
                    Pointstorso[i][j].Dispose();
                }
            }

            for (int i = 0; i < Pointsleg.Length; i++)
            {
                for (int j = 0; j < Pointsleg[i].Length; j++)

                {
                    Pointsleg[i][j].Dispose();
                }
            }

            for (int i=0; i < Curvesleg.Length; i++)
            {
             Curvesleg[i].Dispose();
            }

            for (int i = 0; i < Curvestorso.Length; i++)
            {
                Curvestorso[i].Dispose();
            }

            SphereCenterPoint.Dispose();
            HornCircle1.Dispose();
            HornCircle2.Dispose();
            HornCircle3.Dispose();
            HornCircle4.Dispose();
            HornCircle5.Dispose();
            MirrorPlane.Dispose();


            //FINAL RETURNING

            return OutInfo;

        }
    }
